import RSVP from '../Main/RSVP';
import React from 'react';
import Travel from '../Main/Travel';
import Wedding from '../Main/Wedding';
import { PAGES } from '../constants';

class Main extends React.Component {
    render() {
        return (
            <div className="main">
                <>
                    {this.props.selection === PAGES.RSVP ?
                        <RSVP
                            response={this.props.reponse}
                            name={this.props.name}
                            openRsvp={this.props.openRsvp}
                            openForm={this.props.openForm}
                            rsvp={this.props.rsvp} /> :
                        this.props.selection === PAGES.WEDDING ? <Wedding /> :
                            this.props.selection === PAGES.TRAVEL ? <Travel /> : null
                    }
                </>
            </div>
        )
    }
}

export default Main;
